import React, { useState } from "react";
import css from "./Frame.module.css";

const Frame = ({ bgColor, onSelectColor }) => {
  const [selected, setSelected] = useState(false);
  const handleSelected = () => {
    setSelected(true);
    onSelectColor();
  };
  const className = selected ? `${css.container} ${css.selected}` : css.container;

  return <div className={className} style={{ backgroundColor: bgColor }} onClick={handleSelected}></div>;
};

export default Frame;
